tables.table_schema:
CREATE TABLE robot_movement_history (
  robot_id INT,
  timestamp TIMESTAMP,
  location VARCHAR(255),
  movement_type VARCHAR(50)
 );

CREATE TABLE RobotLocations (id INT PRIMARY KEY, timestamp TIMESTAMP, x_coordinate FLOAT, y_coordinate FLOAT);

CREATE TABLE MovementCommands (id INT PRIMARY KEY, timestamp TIMESTAMP, command VARCHAR(50));

CREATE TABLE NavigationHistory (id INT PRIMARY KEY, timestamp TIMESTAMP, from_location VARCHAR(50), to_location VARCHAR(50));

CREATE TABLE PathHistory ( 
   history_id INT PRIMARY KEY, 
   path_id INT, 
   timestamp TIMESTAMP, 
   completed BOOLEAN 
);

CREATE TABLE RobotStatus ( 
   robot_id INT PRIMARY KEY, 
   battery_level FLOAT, 
   status VARCHAR(50) 
);

CREATE TABLE RobotPaths (
    path_id INT PRIMARY KEY,
    robot_id INT,
    timestamp TIMESTAMP,
    path_data JSON
);

CREATE TABLE RobotErrors (
    error_id INT PRIMARY KEY,
    robot_id INT,
    timestamp TIMESTAMP,
    error_message VARCHAR(255)
);
